	eval("module.exports = {\"title\":\"Migration Guide\",\"order\":3,\"body\":\"<p><a name=\\\"v1-11-x--v2-0-0\\\"></a></p>\\n<h2><a href=\\\"#v1-11-x--v2-0-0\\\">v1.11.x to v2.0.0</a></h2>\\n<p>While v2.0.0 is a full rewrite of the old codebase it should be possible to run in your app\\nwithout completely rewrite your integration.</p>\\n<p><a name=\\\"v1-11-x--v2-0-0-gs\\\"></a></p>\\n<h3><a href=\\\"#v1-11-x--v2-0-0-gs\\\">Getting started</a></h3>\\n<p>The new version does not come with backend, cache and user language detection built in. i18next is more a core library that can be extended with modules on demand. This way it can be seamlessly used in browser, node.js or other javascript runtimes.</p>\\n<p>Modules are available on npm, via bower or on github to download.</p>\\n<p><strong>Hint:</strong> For i18next module: npm is on <code>alpha</code>-tag, github on v2.0.0 branch!</p>\\n<h4>browser</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">import</span> i18next <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'i18next'</span>;\\n<span class=\\\"hljs-keyword\\\">import</span> XHR <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'i18next-xhr-backend'</span>;\\n<span class=\\\"hljs-keyword\\\">import</span> Cache <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'i18next-localstorage-cache'</span>;\\n<span class=\\\"hljs-keyword\\\">import</span> sprintf <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'i18next-sprintf-postprocessor'</span>;\\n<span class=\\\"hljs-keyword\\\">import</span> LanguageDetector <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'i18next-browser-languagedetector'</span>;\\n\\ni18next\\n  .use(XHR)\\n  .use(Cache)\\n  .use(LanguageDetector)\\n  .use(sprintf)\\n  .init(options, callback);\\n</code></pre>\\n<h4>nodejs</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> i18next = <span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'i18next'</span>),\\n  FilesystemBackend = <span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'i18next-node-fs-backend'</span>),\\n  sprintf = <span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'i18next-sprintf-postprocessor'</span>);\\n\\ni18next\\n  .use(FilesystemBackend)\\n  .use(sprintf)\\n  .init(options, callback);\\n</code></pre>\\n<h4>nodejs + express</h4>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">var</span> express = <span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'express'</span>);\\n  i18next = <span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'i18next'</span>),\\n  FilesystemBackend = <span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'i18next-node-fs-backend'</span>),\\n  sprintf = <span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'i18next-sprintf-postprocessor'</span>),\\n  i18nextMiddleware = <span class=\\\"hljs-built_in\\\">require</span>(<span class=\\\"hljs-string\\\">'i18next-express-middleware'</span>);\\n\\ni18next\\n  .use(i18nextMiddleware.LanguageDetector)\\n  .use(FilesystemBackend)\\n  .use(sprintf)\\n  .init(options, callback);\\n\\n<span class=\\\"hljs-keyword\\\">var</span> app = express();\\n\\napp.use(i18nextMiddleware.handle(i18next)); <span class=\\\"hljs-comment\\\">// expose req.t with fixed lng</span>\\napp.post(<span class=\\\"hljs-string\\\">'/locales/add/:lng/:ns'</span>, i18nextMiddleware.missingKeyHandler(i18next)); <span class=\\\"hljs-comment\\\">// serves missing key route for consumers (browser)</span>\\napp.get(<span class=\\\"hljs-string\\\">'/locales/resources.json'</span>, i18nextMiddleware.getResourcesHandler(i18next)); <span class=\\\"hljs-comment\\\">// serves resources for consumers (browser)</span>\\n\\napp.listen(<span class=\\\"hljs-number\\\">3000</span>);\\n</code></pre>\\n<p><a name=\\\"v1-11-x--v2-0-0-comp\\\"></a></p>\\n<h3><a href=\\\"#v1-11-x--v2-0-0-comp\\\">Running v2.0.0 with compatibility flags</a></h3>\\n<p>Version 2.0.0 has a compatibility layer built in which allows to run it like v1.11.x. Keep in mind this layer will be removed in future version.</p>\\n<pre><code class=\\\"language-js\\\"><span class=\\\"hljs-keyword\\\">import</span> i18next <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'i18next'</span>;\\n\\ni18next.init({\\n  compatibilityAPI: <span class=\\\"hljs-string\\\">'v1'</span>,\\n  compatibilityJSON: <span class=\\\"hljs-string\\\">'v1'</span>,\\n  <span class=\\\"hljs-comment\\\">// ...old options from v1</span>\\n}, (err, t) =&gt; { <span class=\\\"hljs-comment\\\">/* resources are loaded */</span> });\\n</code></pre>\\n<table>\\n<thead>\\n<tr>\\n<th>option</th>\\n<th>description</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>compatibilityAPI</td>\\n<td>Will convert init and t options and expose old API functions. Will be removed with future update.</td>\\n</tr>\\n<tr>\\n<td>compatibilityJSON</td>\\n<td>Will allow to use JSON files in v1 format. Using old interpolation prefix, suffix and no need for singular suffix [0] for singular in languages with more then just 1 plural form.</td>\\n</tr>\\n</tbody>\\n</table>\\n<p><a name=\\\"v1-11-x--v2-0-0-depr\\\"></a></p>\\n<h3><a href=\\\"#v1-11-x--v2-0-0-depr\\\">Not supported any longer in v2.0.0!!!</a></h3>\\n<ul>\\n<li>\\n<p><strong>support for older browsers</strong>:</p>\\n<p>time to let them go - use shims when needed.</p>\\n</li>\\n<li>\\n<p><strong>jquery</strong>:</p>\\n<p>we no longer act as a plugin - there will be a separate module by time of release.</p>\\n</li>\\n<li>\\n<p><strong>synchronous loading</strong>:</p>\\n<p><code>i18next.init({ getAsync: false });</code></p>\\n<p>is not supported any longer - as not encouraged by browsers.</p>\\n</li>\\n<li>\\n<p><strong>no conflict:</strong></p>\\n<p><code>i18n.noConflict();</code></p>\\n<p>was removed as i18next registers to window.i18next and no longer to window.i18n</p>\\n</li>\\n<li>\\n<p><strong>indefinite article:</strong></p>\\n<p><code>i18n.t('myKey', { indefinite_article: true })</code></p>\\n<p>was removed - as the solution was too limited - reconsidering adding a better solution in a future v2 release</p>\\n</li>\\n</ul>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/migration/index.md\n ** module id = 499\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/migration/index.md?");

