	eval("module.exports = {\"title\":\"Options\",\"order\":2,\"body\":\"<p><a name=\\\"init-options\\\"></a></p>\\n<h2><a href=\\\"#init-options\\\">init options</a></h2>\\n<table>\\n<thead>\\n<tr>\\n<th>option</th>\\n<th>default setting</th>\\n<th>description</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>debug</td>\\n<td>false</td>\\n<td>logs out more info (console)</td>\\n</tr>\\n<tr>\\n<td>lng</td>\\n<td>undefined</td>\\n<td>language to set (disables user language detection)</td>\\n</tr>\\n<tr>\\n<td>fallbackLng</td>\\n<td>dev</td>\\n<td>language to lookup key if not found on set language</td>\\n</tr>\\n<tr>\\n<td>ns</td>\\n<td>translation</td>\\n<td>string or array of namespaces</td>\\n</tr>\\n<tr>\\n<td>defaultNS</td>\\n<td>translation</td>\\n<td>default namespace used if not passed to translation function</td>\\n</tr>\\n<tr>\\n<td>fallbackNS</td>\\n<td>false</td>\\n<td>string or array of namespaces to lookup key if not found</td>\\n</tr>\\n<tr>\\n<td>whitelist</td>\\n<td>false</td>\\n<td>array of allowed languages</td>\\n</tr>\\n<tr>\\n<td>load</td>\\n<td>all</td>\\n<td>language codes to lookup, given set language is en-US: <code>'all' --&gt; ['en-US', 'en', 'dev']</code>, <code>'currentOnly' --&gt; 'en-US'</code>, <code>'languageOnly' --&gt; 'en'</code></td>\\n</tr>\\n<tr>\\n<td>preload</td>\\n<td>false</td>\\n<td>array of languages to preload</td>\\n</tr>\\n<tr>\\n<td>keySeparator</td>\\n<td>.</td>\\n<td>char to separate keys</td>\\n</tr>\\n<tr>\\n<td>nsSeparator</td>\\n<td>:</td>\\n<td>char to split namespace from key</td>\\n</tr>\\n<tr>\\n<td>saveMissing</td>\\n<td>false</td>\\n<td>calls save missing key function on backend if key not found</td>\\n</tr>\\n<tr>\\n<td>saveMissingTo</td>\\n<td>fallback</td>\\n<td>current or all</td>\\n</tr>\\n<tr>\\n<td>missingKeyHandler</td>\\n<td>false</td>\\n<td><code>function(lng, ns, key, fallbackValue) { }</code> used for custom missing key handling</td>\\n</tr>\\n<tr>\\n<td>parseMissingKeyHandler</td>\\n<td>noop</td>\\n<td>function(key) { // return value to display }</td>\\n</tr>\\n<tr>\\n<td>appendNamespaceToMissingKey</td>\\n<td>false</td>\\n<td>appends namespace to missing key</td>\\n</tr>\\n<tr>\\n<td>postProcess</td>\\n<td>false</td>\\n<td>string or array of postProcessors to apply per default</td>\\n</tr>\\n<tr>\\n<td>returnNull</td>\\n<td>true</td>\\n<td>allows null values as valid translation</td>\\n</tr>\\n<tr>\\n<td>returnEmptyString</td>\\n<td>true</td>\\n<td>allows empty string as valid translation</td>\\n</tr>\\n<tr>\\n<td>returnObjects</td>\\n<td>false</td>\\n<td>allows objects as valid translation result</td>\\n</tr>\\n<tr>\\n<td>returnedObjectHandler</td>\\n<td>noop</td>\\n<td><code>function(key, value, options) {}</code> gets called if object was passed in as key but returnObjects was set to false</td>\\n</tr>\\n<tr>\\n<td>joinArrays</td>\\n<td>false</td>\\n<td>char, eg. \\\\n that arrays will be joined by</td>\\n</tr>\\n<tr>\\n<td>overloadTranslationOptionHandler</td>\\n<td>function(args) { return { defaultValue: args[1] }; };</td>\\n<td>default: sets defaultValue</td>\\n</tr>\\n<tr>\\n<td>interpolation</td>\\n<td>{}</td>\\n<td>see interpolation options below</td>\\n</tr>\\n<tr>\\n<td>detection</td>\\n<td>undefined</td>\\n<td>options for language detection - see detector documentation</td>\\n</tr>\\n<tr>\\n<td>backend</td>\\n<td>undefined</td>\\n<td>options for backend - see backend documentation</td>\\n</tr>\\n<tr>\\n<td>cache</td>\\n<td>undefined</td>\\n<td>options for cache layer  see cache documentation</td>\\n</tr>\\n</tbody>\\n</table>\\n<p><a name=\\\"interpolation-options\\\"></a></p>\\n<h6><a href=\\\"#interpolation-options\\\">interpolation options</a></h6>\\n<table>\\n<thead>\\n<tr>\\n<th>option</th>\\n<th>default setting</th>\\n<th>description</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>escapeValue</td>\\n<td>true</td>\\n<td>escapes passed in values to avoid xss injection</td>\\n</tr>\\n<tr>\\n<td>prefix</td>\\n<td>{{</td>\\n<td>prefix for interpolation</td>\\n</tr>\\n<tr>\\n<td>suffix</td>\\n<td>}}</td>\\n<td>suffix for interpolation</td>\\n</tr>\\n<tr>\\n<td>prefixEscaped</td>\\n<td>undefined</td>\\n<td>escaped prefix for interpolation (regexSafe)</td>\\n</tr>\\n<tr>\\n<td>suffixEscaped</td>\\n<td>undefined</td>\\n<td>escaped suffix for interpolation (regexSafe)</td>\\n</tr>\\n<tr>\\n<td>unescapeSuffix</td>\\n<td>undefined</td>\\n<td>suffix to unescaped mode</td>\\n</tr>\\n<tr>\\n<td>unescapePrefix</td>\\n<td>-</td>\\n<td>prefix to unescaped mode</td>\\n</tr>\\n<tr>\\n<td>nestingPrefix</td>\\n<td>$t(</td>\\n<td>prefix for nesting</td>\\n</tr>\\n<tr>\\n<td>nestingSuffix</td>\\n<td>)</td>\\n<td>suffix for nesting</td>\\n</tr>\\n<tr>\\n<td>nestingPrefixEscaped</td>\\n<td>undefined</td>\\n<td>escaped prefix for nesting (regexSafe)</td>\\n</tr>\\n<tr>\\n<td>nestingSuffixEscaped</td>\\n<td>undefined</td>\\n<td>escaped suffix for nesting (regexSafe)</td>\\n</tr>\\n<tr>\\n<td>defaultVariables</td>\\n<td>undefined</td>\\n<td>default variables to use in interpolation replacements</td>\\n</tr>\\n</tbody>\\n</table>\\n\"}\n\n/*****************\n ** WEBPACK FOOTER\n ** ./docs/options/index.md\n ** module id = 500\n ** module chunks = 0\n **/\n//# sourceURL=webpack:///./docs/options/index.md?");

